import React from "react";

const AddCompany = () => {
  return (
    <div className="container">
      <h5>Company details: </h5>
      <hr />
      <div className="input-container">
        <p>Company:</p>
        <Form.Control
          id="company-field"
          type="text"
          name="companyName"
          value={companyName}
          onChange={(e) => {
            setCompanyName(e.target.value);
          }}
        />
      </div>
      <div className="input-container">
        <p>Address:</p>
        <Form.Control
          type="text"
          name="address"
          value={address}
          onChange={(e) => {
            setAddress(e.target.value);
          }}
        />
      </div>
      <div className="input-container">
        <p>Address 2:</p>
        <Form.Control
          type="text"
          name="address2"
          value={address2}
          onChange={(e) => {
            setAddress2(e.target.value);
          }}
        />
      </div>
      <div className="input-container">
        <p>City:</p>
        <Form.Control
          as="select"
          name="city"
          value={city_id}
          onChange={(e) => {
            setCity(e.target.value);
          }}
        >
          <option value="">Select city</option>
          {cities.map((city) => (
            <option key={city.id} value={city.id}>
              {city.city}
            </option>
          ))}
        </Form.Control>
      </div>
      <div className="input-container">
        <p>Website url:</p>
        <Form.Control
          type="text"
          name="website-url"
          value={website_url}
          onChange={(e) => {
            setWebsiteUrl(e.target.value);
          }}
        />
      </div>
      <Button type="submit" onClick={onSubmit} className="accept-button">
        Accept
      </Button>
    </div>
  );
};

export default AddCompany;
